/* src/utils/data.js */
export const rooms = ["1번 방"];  // 1번 방만
// 05:00 ~ 12:00, 30분 단위
export const slots = Array.from({ length: (12 - 5) * 2 + 1 }, (_, i) => {
  const hour = 5 + Math.floor(i / 2);
  const minute = i % 2 === 0 ? "00" : "30";
  return `${hour.toString().padStart(2, "0")}:{minute}`;
});
